import React from 'react'
import {AppContext} from './context'
import { useContext } from 'react'

const Movies = () => {
  const {movie}=useContext(AppContext)
  return (
    <>
      {movie.map((curval)=>{
        return(
          <div>{curval.Title} </div>
        )
      })}
    </>
  )
}

export default Movies
